import React from 'react';
import styled from 'styled-components';

const SearchInput = styled.input`
  width: 100%;
  padding: 10px;
  margin-top: 10px;
  border-radius: 5px;
  border: none;
  outline: none;
`;

const SearchBar = ({ onSearch }) => (
  <SearchInput
    type="text"
    placeholder="Search songs..."
    onChange={(e) => onSearch(e.target.value)}
  />
);

export default SearchBar;
